import React, { useState } from "react";
import { useLocation, useHistory } from "react-router-dom";
import { FaFileDownload, FaRegCopy, FaRegEdit, FaPlay } from "react-icons/fa";
import LoadingSpinner from "./LoadingSpinner";
import api from "../services/api";
import "./TranscriptPage.css";

function TranscriptPage() {
  const [isEditing, setIsEditing] = useState(false);
  const [editedTranscript, setEditedTranscript] = useState("");
  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState(null);
  const location = useLocation();
  const history = useHistory();
  const transcript = location.state?.transcript || "";

  React.useEffect(() => {
    setEditedTranscript(transcript);
  }, [transcript]);

  const handleCopy = async () => {
    try {
      await navigator.clipboard.writeText(editedTranscript);
      // Optional: Add a toast notification here
    } catch (err) {
      setError("Failed to copy transcript");
    }
  };

  const handleDownload = () => {
    try {
      const blob = new Blob([editedTranscript], { type: "text/plain" });
      const url = URL.createObjectURL(blob);
      const a = document.createElement("a");
      a.href = url;
      a.download = "transcript.txt";
      document.body.appendChild(a);
      a.click();
      document.body.removeChild(a);
      URL.revokeObjectURL(url);
    } catch (err) {
      setError("Failed to download transcript");
    }
  };

  const handleGeneratePresentation = async () => {
    try {
      setIsLoading(true);
      setError(null);

      // Navigate to presentation page with transcript
      history.push("/presentation", { text: editedTranscript });
    } catch (err) {
      setError("Failed to generate presentation");
    } finally {
      setIsLoading(false);
    }
  };

  const handleSaveEdit = () => {
    setIsEditing(false);
    // Optional: Add save to backend logic here
  };

  if (isLoading) {
    return (
      <LoadingSpinner
        text="Processing transcript..."
        size="large"
        spinnerType="wave"
      />
    );
  }

  return (
    <div className="transcript-page">
      <div className="transcript-header">
        <h1>Transcript</h1>
        <div className="transcript-actions">
          <button
            className="action-button"
            onClick={() => setIsEditing(!isEditing)}
            title={isEditing ? "Save changes" : "Edit transcript"}
          >
            <FaRegEdit />
            {isEditing ? "Save" : "Edit"}
          </button>
          <button
            className="action-button"
            onClick={handleCopy}
            title="Copy to clipboard"
          >
            <FaRegCopy />
            Copy
          </button>
          <button
            className="action-button"
            onClick={handleDownload}
            title="Download transcript"
          >
            <FaFileDownload />
            Download
          </button>
          <button
            className="action-button primary"
            onClick={handleGeneratePresentation}
            title="Generate presentation"
          >
            <FaPlay />
            Create Presentation
          </button>
        </div>
      </div>

      {error && <div className="error-message">{error}</div>}

      <div className="transcript-content">
        {isEditing ? (
          <textarea
            value={editedTranscript}
            onChange={(e) => setEditedTranscript(e.target.value)}
            className="transcript-editor"
            placeholder="Transcript content..."
          />
        ) : (
          <div className="transcript-text">
            {editedTranscript.split("\n").map((paragraph, index) => (
              <p key={index}>{paragraph}</p>
            ))}
          </div>
        )}
      </div>

      {isEditing && (
        <div className="edit-actions">
          <button
            className="cancel-button"
            onClick={() => {
              setIsEditing(false);
              setEditedTranscript(transcript);
            }}
          >
            Cancel
          </button>
          <button className="save-button" onClick={handleSaveEdit}>
            Save Changes
          </button>
        </div>
      )}
    </div>
  );
}

export default TranscriptPage;
